        content: "\u003cp\u003ePlease make sure you are familiar with the following concepts before you start (it\u0026rsquo;s not a lot if I can fit it in a single diagram) so you\ndon\u0026rsquo;t feel overwhelmed during the hands-on sessions. Watching someone else coding in a live session with their own environment and\nworkflow can be confusing.\u003c/p\u003e\n\u003cdiv class=\"mermaid bg-light text-center\"\u003e\n    \n%%{init: {\u0026#39;theme\u0026#39;:\u0026#39;dark\u0026#39;}}%%\nflowchart LR\n    A((\u0026#34;\u0026amp;nbsp; \u0026amp;nbsp; \u0026amp;nbsp; \u0026#34;))\n    B(\u0026#34;OpenFOAM build system\u0026#34;)\n    C(\u0026#34;C\u0026#43;\u0026#43;\u0026#34;)\n    D(\u0026#34;MPI\u0026#34;)\n    E(\u0026#34;CMD\u0026#34;)\n    F(\u0026#34;Bash\u0026#34;)\n    G(\u0026#34;Git\u0026#34;)\n    H(\u0026#34;HPC Environment\u0026#34;)\n    I(\u0026#34;Make/files\u0026#34;)\n    J(\u0026#34;Make/options\u0026#34;)\n    K(\u0026#34;wmake\u0026#34;)\n    L(\u0026#34;Github account\u0026#34;)\n    M(\u0026#34;IDE\u0026#34;)\n    N(\u0026#34;VSCode\u0026#34;)\n    O(\u0026#34;Vim...\u0026#34;)\n\n    A --- C \u0026amp; B \u0026amp; E\n    E --- F \u0026amp; G \u0026amp; H\n    B -.- I \u0026amp; J \u0026amp; K\n    D \u0026amp; L \u0026amp; M --- A\n    O \u0026amp; N -.- M\n\n    classDef graphDate fill-opacity:0.15,color:#E1B028\n    classDef date fill-opacity:0.85,color:#FFFFFF,fill:#1d0e4e\n    class A,B,C,E,F,G,L date\n\u003c/div\u003e\n\n\u003ch2 id=\"required-skills-and-knowledge\"\u003eRequired skills and knowledge \u003ca href=\"#required-skills-and-knowledge\" class=\"anchor\" aria-hidden=\"true\"\u003e#\u003c/a\u003e\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eBasic C++ programming knowledge (This is a \u003cstrong\u003emust\u003c/strong\u003e, at least you\u0026rsquo;ve worked with templates before).\u003c/li\u003e\n\u003cli\u003eBeing familiar with OpenFOAM environment and build system (At least, you\u0026rsquo;ve compiled a solver or a library before).\u003c/li\u003e\n\u003cli\u003eMPI knowledge is optional.\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"required-tools\"\u003eRequired tools \u003ca href=\"#required-tools\" class=\"anchor\" aria-hidden=\"true\"\u003e#\u003c/a\u003e\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eAn OpenFOAM installation on a recent Linux distribution (refer to \u003ca href=\"/workshop/hands-on/openfoam-env-101/\"\u003eOpenFOAM Environment 101\u003c/a\u003e\nfor recommended setup).\u003c/li\u003e\n\u003cli\u003eKnowledge of the common command line interface (Bash, Git) is recommended.\u003c/li\u003e\n\u003cli\u003eA Github Account (needed to view video content on this website).\u003c/li\u003e\n\u003cli\u003eAn IDE (configured for C++ development) is optional but recommended (or use Github CodeSpaces).\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"a-quick-test\"\u003eA quick test \u003ca href=\"#a-quick-test\" class=\"anchor\" aria-hidden=\"true\"\u003e#\u003c/a\u003e\u003c/h2\u003e\n\u003cdiv class='quizdown'\u003e\n  \n\n---\nprimary_color: cyan\nsecondary_color: lightgray\ntext_color: black\nshuffle_questions: false\nshuffle_answers: true\n---\n\n## Understanding of templated code\n\nAssume we have a templated function defined in a *.C file like this:\n```typescript\ntemplate\u0026#60;class T\u0026#62;\nT::componentType globalMax(const T\u0026 v) {\n    return returnReduce(max(v),  maxOp\u0026#60;T::componentType\u0026#62;());\n}\n```\n\nHow would use it on a `const volScalarField\u0026 vf;`?\n\n\u003e Two answers are correct. max() is itself a templated function!\n\n- [x] `globalMax(vf)`\n- [ ] `globalMax\u003cscalar\u003e(vf)`\n- [x] `globalMax\u003cvolScalarField\u003e(vf)`\n- [ ] Not usable\n\n## Basic object orientation\n\nAssume we have the following class declaration:\n\n```java\nclass MyClass\n{\n    //- Data members\n    scalar m1_;\npublic:\n    scalar m1() const {\n        return m1_;\n    }\n};\n```\n\nHow would you access `m1` for reading outside of `MyClass` (Assume: `MyClass  obj;`)?\n\n\u003e Pay attention to access specifiers\n\n- [ ] `obj.m1_`\n- [x] `obj.m1()`\n- [ ] Not easily possible\n\n## Basic object orientation\n\nAssume we have the following class declaration:\n\n```java\nclass MyClass\n{\n    //- Data members\n    scalar m1_;\npublic:\n    scalar m1() const {\n        return m1_;\n    }\n};\n```\n\nHow would you access `m1` for writing outside of `MyClass` (Assume: `MyClass  obj;`)?\n\n\u003e Pay attention to access specifiers\n\n- [ ] `obj.m1_`\n- [ ] `obj.m1()`\n- [x] Not easily possible\n\n## OpenFOAM compilation workflow\n\nWhich of these environment variables you think are usually used as destinations for library/binary compilation\nwhen it comes to OpenFOAM shared libs and solvers?\n\n\u003e Maybe the ones which end with *BIN?!\n\n- [x] `$FOAM_USER_LIBBIN`\n- [x] `$FOAM_LIBBIN`\n- [x] `$FOAM_APPBIN`\n- [ ] `$FOAM_APP`\n- [ ] `$WM_PROJECT`\n- [x] `$FOAM_USER_APPBIN`\n- [ ] `$FOAM_SITE_DIR`\n\n## OpenFOAM compilation workflow\n\nWhen you `wmake libso`, you're compiling your\n\n\u003e The hint is in the command!\n\n- [ ] solver or utility binary\n- [x] library as a shared object\n- [ ] library as a static library\n\n\n\u003c/div\u003e\n\n"
