        content: "\u003cscript type=\"text/javascript\" src=\"/js/lock.js\"\u003e\u003c/script\u003e\n\u003cdiv class=\"lecture-locked\"\u003e\u003c/div\u003e\n\u003cdiv class=\"lecture\"\u003e\n\u003cdiv class='card-bar'\u003e\u003c/div\u003e\n\u003cdiv class='card-body'\u003e\n    \u003ch3 class='h4 card-title'\u003e👋 This content will be available on the 3rd of April 2023\u003c/h3\u003e\n    \u003cform class='row gx-2 gy-3 email-form' method='post' name='newsletter' onsubmit='subscribeButton.disabled=!0'\u003e\u003cinput\n            type='hidden' name='form-name' value='newsletter'\u003e\n        \u003cdiv class='col-md-4'\u003e\u003ca id='loginButton'\n                href='https://eveeno.com/parallelization_in_openfoam'\n                class='btn btn-primary w-100'\u003eRegister at eveeno.com\u003c/a\u003e\u003c/div\u003e\n    \u003c/form\u003e\n\u003c/div\u003e\n\u003c/div\u003e\n\n"
