        id: 11,
        href: "/workshop/chapters/02-collective-comms-quiz/",
        title: "Collective comms - Quiz",
        description: "Put what you have learned about Collective communication in OpenFOAM to the test.",
        content: " --- primary_color: cyan secondary_color: lightgray text_color: black shuffle_questions: false shuffle_answers: true --- ## Basic collective comms Consider the following code snippet: ```java // obj.update() returns a bool, whether obj was updated or not. updated = Foam::returnReduce(obj.update(), andOp()); ``` The value of `updated` will: - [x] Be true if `obj` was updated on all processes. - [ ] Be true if `obj` was updated on at least one process. - [ ] Be always false, because `update()` is never called. ## Gathering values from processes Consider the following code snippet: ```java label i = random(0, 100); // Generate a random int locally Pstream::gather(i, maxOp()); ``` The value of `i` will: - [x] Be the greatest value of `i` on all processes, but gets stored only on master. - [ ] Be the greatest value of `i` on all processes, stored on all processes. - [ ] Be untouched on all processes. "
